{
	getHref(url: Url | string) {
		url = typeof url === 'string' ? parseUrl(url) : url;
		return `${url.path ? `?${url.path}` : ''}${
			url.hash ? `#${url.hash}` : ''
		}`;
	},

	serialize(url) {
		history.pushState({ url }, '', this.getHref(url));
	},

	deserialize() {
		return (
			history.state?.url || {
				path: location.search.slice(1),
				hash: location.hash.slice(1),
			}
		);
	},
}

